import React from 'react';
//Styles imports
import {Navbar, NavbarBrand, Nav, NavItem} from 'reactstrap'

const NaviBar = ({}) => (
  <div>
  <Navbar className="navbar-expand-lg navbar-dark bg-default" expand="md">
    <NavbarBrand>
      <img src="https://staticaltmetric.s3.amazonaws.com/uploads/2015/12/Altmetric_rgb_white.png" alt="logo" className="img-fluid"/>
    </NavbarBrand>
    <Nav>
      <NavItem>Accueil</NavItem>
    </Nav>
  </Navbar>
</div>

);

export default NaviBar;
